		main = "Commander, this fleet only functions because of you. Don't get sloppy on us. |Wales and Yorkie? It's a bit of a shame that they don't act more like cute little sisters, but I am glad that they have strong personalities. |In my eyes, there is no leader in this world more worthy of my loyalty than Her Majesty, Queen Elizabeth. Does that make sense to you, Commander? |The Royals' cuisine is all bland? Hogwash. That's just an unfortunate stereotype.",
		voice_key_2 = -1,
		profile = "The nameship of the King George V-class battleships is none other than me. I served as flagship for my country, leading the fleet into numerous battles including the fateful encounter with Bismarck. After getting a brief taste of that thrill, I have been craving to cross swords with her once again... But I digress - is there anything else you'd like to know about me?",
		mission_complete = "Supper tastes best after the day's missions are all complete. Wouldn't you agree, Commander?",
		headtouch = "",
		feeling2 = "By the way, Commander, are you a good cook? Hmm? Despite my appearances, I've spent many hours honing my skills to sate my own appetite.",
		feeling4 = "Commander, so you're learning how to cook? Hmm, colour me impressed. I look forward to trying the dish that you're making for me.",
		unlock = "So this is my new battlefield. Ahh, how I've long awaited this... By the way, are you my commander? You are in the presence of King George V – do use me well.",
		battle = "Let us go forth and plant our banners!",
		login = "Commander, did you already partake of supper?",
		vote = "",
		detail = "My standing within the Royal Family? Hmm... If I had to draw a comparison, I'd say \"Knight Commander\" would be the most fitting... Hahaha...",
		couple_encourage = {
