		feeling5 = "",
		main = "The Dragon Empery's traditional dances seem difficult to learn... Eh, you'd like to learn them with me? In that case, we should be able to learn them in no time~ |Eh, fireworks display? Um, I think I'll pass... I'm... not good around fire. |(yawns) ... Ahh, I stayed up too late last night exchanging stories with the Empery girls, so I'm really sleepy...",
		voice_key_2 = -1,
