		profile = "I am {namecode:11}, a special-type destroyer! Destroyer Division Six consisted of me and my sisters! I was the first to be built and the first to be sunk! The Battle of Guadalcanal? I-I was trying to cast my light on the enemy! I was by no means scared of them! ... Ahem, you shall witness how strong I truly am... that you will!",
