		voice_key_2 = -1,
		profile = "Hai hai! The name's Aoba! I spent most of my days in the 6th Fleet, took part in many battles with my sisters, and did my best to survive until the end. Let's drop this boring topic, shall we? I was a writer for the Navy once, so I've picked up a thing or two. Commander, anything juicy going on around you lately?",
