		main = "Why do we need to write like this? Is it wrong to do it this way? Why?|I saw something interesting outside! Can I go check it out?|I wonder where those ants are heading... I wanna find out!",
		voice_key_2 = -1,
		profile = "I'm Mutsu, second ship of the Nagato class! Nagato and I used to swap back and forth between being the Combined Fleet's flagship! Later on, Yamato took on the role, though! Isn't it amazing how much there is to see in the world~? My third turret? Uh... I think it'll be okay this time.",
		mission_complete = "Commander? I put the mission rewards on my turret and brought them here! But don't wake up Mr. Kitty!",
		headtouch = "",
		feeling2 = "Ever since Nagato and I were at Hashira Island, I've wondered... Why is the sky blue? Why can birds fly? Why do we fight? ... There are so many things I wonder...",
		feeling4 = "Commander, can we play? Umm, if you've got work to do, I can come back later. I have so much to ask, and also so, sooo much I wanna tell you!",
		unlock = "Hello, I'm Mutsu! Nagato's little sister! Um, are you a commander? Why? How do you become a commander? Is it cool to be one? Tell me, I wanna know!",
