		headtouch = "Commander, could you not ruffle up my hair like that...?",
		feeling2 = "I sailed alone, fought alone, and sunk alone... Although I am who I am, didn't I still contribute to Iron Blood's cause?",
		feeling4 = "Commander, rather than sink all alone, will I be able to face my final moments together with you this time?",
		unlock = "No matter where I go, the war never ends... Deutschland-class armored ship number 3, Admiral Graf Spee, reporting for duty.",
		battle = "For the honor and prosperity of Iron Blood, and for even greater glory!",
		login = "I will fight for you till the very end.",
