		expedition = "Hey, Commander, could I lend my SG radar to my sisters this time?",
		win_mvp = "... We actually won?",
		home = "Did everyone make it back safe and sound? Good. But there's spare parts lying around in the docks now... I wonder why...",
		mission = "Bit by bit we'll build the foundation for victory. We'll start by doing missions.",
		touch2 = "If this makes you feel good, then... I'm fine with it.",
		feeling1 = "SG, protect me...",
		skill = "SG, give me your power!",
		drop_descrip = "Brooklyn-class Light Cruiser – Helena, Hull Number CL-50!",
		mail = "You've got new mail. It's important to stay in touch with your loved ones.",
		lose = "... Please, save me... Ignore the enemy, just let them go...",
		propose = "A promise... from you, Commander? I see... I'm so happy...",
		hp_warning = "SG, lock on the enemy position!",
		id = 900132,
		voice_key = -1,
		feeling5 = "I believe that you will bring us hope, Commander. This time, I'll fight to the end... Just the thought of saying goodbye to the person I love makes me feel like my heart will tear in half...",
		main = "Are you trying to hide, Commander? No matter where you hide, I know where you are.|Commander, what should we do after the war?|If only my guns could be as strong as my radar...",
		voice_key_2 = -1,
		profile = "I was designed to be on par with heavy cruisers, but just my power alone isn't enough to save everyone... Commander, can you help me?",
		mission_complete = "Resources are no good if they just pile up. We should make use of them.",
		headtouch = "",
		feeling2 = "If only my recon could help the others...",
		feeling4 = "I think I've been more at ease lately... No, I was just too tense up until now. It's all thanks to the courage you've given me by being beside me.",
		unlock = "Nice to meet you, Commander. I'm Helena. My strong suit is enemy reconnaissance. Please... guide us towards victory.",
		battle = "The enemy can't hide from me.",
