		main = "What do you think of my sunglasses? I dig them, personally. Hahaha!|Nothing beats an ice cold Oxy Cola on a summer day! Here, take one, Commander... Oh right, you can't drink these. This one's for you.|We've still got some summer left, so why not try to plan a \"Beach World Tour\" for us?",
		voice_key_2 = -1,
