		headtouch = "",
		feeling2 = "",
		feeling4 = "",
		unlock = "Heh heh, the warm sun and the sea breeze really hit the spot, don't they? Alright, let's get out there and enjoy ourselves! That's what you've been waiting for, right, Commander?",
		battle = "",
		login = "Ooh, you're just in time. Commander, mind helping me set up this parasol?",
