		drop_descrip = "Battleship – Friedrich der Große.",
		mail = "Shall I sing the contents of this message for you?",
		lose = "Please await our next performance...",
		propose = "From now on, I shall share everything with you - your sorrow, your joy, your pain, and your pleasure. My child, I will always, always welcome you into my embrace...",
		hp_warning = "I shall persevere yet.",
		id = 499020,
		voice_key = 49902,
		feeling5 = "Please dote upon me more. Yes, more... more...!",
		main = "All those emotions that you’ve bottled up through all those conflicts... Listen to my concert, and let it all out. |My appearance upon the battlefield gives off an air of cruelty? Hehe... I’ll take that as a compliment. |Even should you anger me, I’ll forgive you as long as you properly apologize.",
		voice_key_2 = -1,
		profile = "I am Friedrich der Große, prototype H-class battleship of the Iron Blood Navy. Come, my child... If you are unable to sleep, allow me to play you a lullaby.",
		mission_complete = "Now then, what kind of reward would you like?",
		headtouch = "",
		feeling2 = "I never should have come to exist in this world... But since I am here, there must be a higher principle behind it...",
		feeling4 = "I do prefer this to fighting. Here, my child. Open your mouth~ ahhn~",
		unlock = "You've returned to my side once more, my child. Tell me, what is it that you wish for? Wealth? Glory? Or perhaps eternal youth?",
		battle = "Let us play a requiem! Resound, o hatred, fear, and despair—!",
		login = "The performers can wait no longer! Hurry, let us raise the curtains of battle!",
